import React from 'react';
import { Chart } from "react-google-charts";

const data = [
  ["Month", "Registrations"],
  ["January", 500],
  ["February", 700],
  ["March", 500],
  ["April", 700],
  ["May", 500],
  ["June", 500],
  ["July", 700],
  ["August", 500],
  ["September", 500],
  ["October", 700],
  ["November", 500],
  ["December", 700],
];

const options = {
  title: "Sales Over the Week",
  curveType: "function", // Smooth the lines
  hAxis: {
    title: "Day",
  },
  vAxis: {
    title: "Sales (in USD)",
  },
  legend: { position: "bottom" },
  colors: ["#1A56DB"], // Customize the color of the line
};

const LineChart = () => {
  return (
    <div>
      <Chart
        chartType="LineChart"
        width="100%"
        height="400px"
        data={data}
        options={options}
        loader={<div>Loading Chart...</div>}
      />
    </div>
  );
};

export default LineChart;
